  CREATE OR REPLACE FUNCTION "CFCUSER"."MENUDO" (P_CODIGO_SUC NUMBER, P_CODIGO_MONEDA NUMBER) RETURN NUMBER AS 
  menudo_porcentaje NUMBER;
  saldo_inicial_val NUMBER;
  resultado NUMBER;

BEGIN
-- SEGURO_MAX = Son constantes. Monto asegurado de la tabla SUCURSALES.
   BEGIN
     SELECT PORCEN_MENUDO INTO menudo_porcentaje
     FROM SUCURSALES,SUCURSAL_PORCENT 
     where SUCURSALES.CODIGO_SUCURSAL = P_CODIGO_SUC AND 
      SUCURSALES.ID = SUCURSAL_PORCENT.ID_SUCURSAL AND
      SUCURSAL_PORCENT.ID_MONEDA = P_CODIGO_MONEDA; --AND FECHA >= CURRENT_DATE AND FECHA < CURRENT_DATE+1 
   EXCEPTION
          WHEN TOO_MANY_ROWS THEN
            menudo_porcentaje := -2;
            DBMS_OUTPUT.PUT_LINE('Ocurrio un error (TOO_MANY_ROWS) al calcular SALDO_AUTORIZADO. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
          WHEN NO_DATA_FOUND THEN
            menudo_porcentaje := -1;
            DBMS_OUTPUT.PUT_LINE('Ocurrio un error (NO_DATA_FOUND) al calcular SALDO_AUTORIZADO. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
   END;
   saldo_inicial_val := SALDO_INICIALFX(P_CODIGO_SUC, P_CODIGO_MONEDA);
   resultado := (menudo_porcentaje * saldo_inicial_val) / 100;
    
  RETURN resultado;
END MENUDO;

