  CREATE OR REPLACE FUNCTION "CFCUSER"."OCIOSO" (P_CODIGO_SUC NUMBER, P_CODIGO_MONEDA NUMBER) RETURN NUMBER AS 
  ocioso_val NUMBER;
  saldo_actual_val NUMBER;
  reserva_val NUMBER;
  menudo_val NUMBER;
  rmbarra_val NUMBER;
  lcsr_val NUMBER;
  resultado NUMBER;

BEGIN
-- Ocioso = Saldo_Actual - Reserva - Menudo - Rmbarra - LCSr
   saldo_actual_val := SALDO_ACTUAL(P_CODIGO_SUC, P_CODIGO_MONEDA);
   reserva_val := RESERVA(P_CODIGO_SUC, P_CODIGO_MONEDA);
   menudo_val := MENUDO(P_CODIGO_SUC, P_CODIGO_MONEDA);
   rmbarra_val := RMBARRA(P_CODIGO_SUC, P_CODIGO_MONEDA);
   lcsr_val := LCSR(P_CODIGO_SUC, P_CODIGO_MONEDA);
   
   ocioso_val := saldo_actual_val - reserva_val - menudo_val - rmbarra_val - lcsr_val;
   resultado := ocioso_val;
    
  RETURN resultado;
END OCIOSO;

