--------------------------------------------------------
--  DDL for Function RM
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "CFCUSER"."RM" (P_CODIGO_SUC NUMBER, P_CODIGO_MONEDA NUMBER) RETURN NUMBER AS 
   saldo_actual_valor NUMBER;
   saldo_actual_anterior NUMBER; -- Este esta ya persistido en la tabla PIVOT.
   resultado NUMBER;

BEGIN
--Rm =| Saldo_Actual  Saldo_Actual(5 minutos antes)|	Tomar encuenta que esta formula está en valor adsoluto
-- NOTA: PIVOT se resetea diariamente asi q remuevo los filtros de fecha.
   BEGIN
     SELECT SALDO INTO saldo_actual_anterior
     FROM PIVOT 
     where COD_AGENCIA = P_CODIGO_SUC AND COD_MONEDA = P_CODIGO_MONEDA AND rownum = 1
     ORDER BY ID DESC; --AND FECHA >= CURRENT_DATE AND FECHA < CURRENT_DATE+1 
    EXCEPTION
        WHEN TOO_MANY_ROWS THEN
          saldo_actual_anterior := -2;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (TOO_MANY_ROWS) al calcular RM. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
        WHEN NO_DATA_FOUND THEN
          saldo_actual_anterior := -1;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (NO_DATA_FOUND) al calcular RM. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
    END;

  saldo_actual_valor := SALDO_ACTUAL(P_CODIGO_SUC, P_CODIGO_MONEDA);
  resultado := ABS (saldo_actual_valor - saldo_actual_anterior );
  
  RETURN resultado;
END RM;
  -- Testing data:
   -- Agencia: 1150
   -- MONEDA: 1

