--  DDL for Function RMBARRA
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "CFCUSER"."RMBARRA" (P_CODIGO_SUC NUMBER, P_CODIGO_MONEDA NUMBER) RETURN NUMBER AS 
   suma_rangos_moviles NUMBER;
   cantidad_rangos_moviles NUMBER; 
   resultado NUMBER;

BEGIN
--Rmbarra = SRm/Cantidad de valores	Promedio del rango movil al ultimo corte según la hora. Excluir los valores en cero.
-- NOTA: PIVOT se resetea diariamente asi q remuevo los filtros de fecha.
   BEGIN
     SELECT SUM(RM) INTO suma_rangos_moviles
     FROM PIVOT 
     where COD_AGENCIA = P_CODIGO_SUC AND COD_MONEDA = P_CODIGO_MONEDA AND RM > 0;
     --AND FECHA >= CURRENT_DATE AND FECHA < CURRENT_DATE+1 
     EXCEPTION
        WHEN TOO_MANY_ROWS THEN
          suma_rangos_moviles := -2;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (TOO_MANY_ROWS) al calcular RMBARRA. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
        WHEN NO_DATA_FOUND THEN
          suma_rangos_moviles := -1;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (NO_DATA_FOUND) al calcular RMBARRA. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
    END;
  BEGIN
  SELECT COUNT(ID) INTO cantidad_rangos_moviles
   FROM PIVOT 
   where COD_AGENCIA = P_CODIGO_SUC AND COD_MONEDA = P_CODIGO_MONEDA AND RM > 0;
   EXCEPTION
        WHEN TOO_MANY_ROWS THEN
          cantidad_rangos_moviles := -2;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (TOO_MANY_ROWS) al calcular RMBARRA. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
        WHEN NO_DATA_FOUND THEN
          cantidad_rangos_moviles := -1;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (NO_DATA_FOUND) al calcular RMBARRA. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
    END; 
   resultado := suma_rangos_moviles / cantidad_rangos_moviles;
  
  RETURN resultado;
END RMBARRA;

/
