  CREATE OR REPLACE FUNCTION "CFCUSER"."SALDO_ACTUAL" (P_CODIGO_SUC NUMBER, P_CODIGO_MONEDA NUMBER) RETURN NUMBER AS 
 
  saldo_inicial NUMBER;
  total_mov_entrada NUMBER;
  total_mov_salida NUMBER;
  resultado NUMBER;
  
BEGIN
-- NOTA: SALDOS se resetea diariamente asi q remuevo los filtros de fecha.
  
   saldo_inicial := SALDO_INICIALFX(P_CODIGO_SUC, P_CODIGO_MONEDA);
   
    BEGIN 
      select sum(monto_valor) INTO total_mov_entrada from MOVIMIENTOS where CODIGO_AGENCIA = P_CODIGO_SUC and ENTRADA_SALIDA = 'E'
        AND CODIGO_MONEDA = P_CODIGO_MONEDA;
    EXCEPTION
        WHEN TOO_MANY_ROWS THEN
          total_mov_entrada := -1;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (TOO_MANY_ROWS) al calcular SALDO_ACTUAL - total_mov_entrada. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
        WHEN NO_DATA_FOUND THEN
          total_mov_entrada := -2;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (NO_DATA_FOUND) al calcular SALDO_ACTUAL - total_mov_entrada. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
    END;    
    BEGIN 
      select sum(monto_valor) INTO total_mov_salida from MOVIMIENTOS where CODIGO_AGENCIA = P_CODIGO_SUC and ENTRADA_SALIDA = 'S'
        AND CODIGO_MONEDA = P_CODIGO_MONEDA;
    EXCEPTION
        WHEN TOO_MANY_ROWS THEN
          total_mov_salida := -1;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (TOO_MANY_ROWS) al calcular SALDO_ACTUAL - total_mov_salida. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
        WHEN NO_DATA_FOUND THEN
          total_mov_salida := -2;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (NO_DATA_FOUND) al calcular SALDO_ACTUAL - total_mov_salida. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
    END;   
    
    
  
  resultado := saldo_inicial + total_mov_entrada - total_mov_salida;
  
  RETURN resultado;
  
END SALDO_ACTUAL;
