  CREATE OR REPLACE FUNCTION "CFCUSER"."SALDO_INICIALFX" (P_CODIGO_SUC NUMBER, P_CODIGO_MONEDA NUMBER) RETURN NUMBER AS 
  saldo_inicial NUMBER;
  resultado NUMBER;
  
BEGIN
-- NOTA: SALDOS se resetea diariamente asi q remuevo los filtros de fecha.
  BEGIN 
