          saldo_inicial := -1;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (TOO_MANY_ROWS) al calcular SALDO_ACTUAL - saldo_inicial. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
        WHEN NO_DATA_FOUND THEN
          saldo_inicial := -2;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (NO_DATA_FOUND) al calcular SALDO_ACTUAL - saldo_inicial. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
    END;
    IF saldo_inicial = NULL THEN
         saldo_inicial := 0;
    END IF;
    resultado := saldo_inicial;
  RETURN resultado;
