--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "CFCUSER"."UTILIZACION" (P_CODIGO_SUC NUMBER, P_CODIGO_MONEDA NUMBER) RETURN NUMBER AS 
   suma_ociosos NUMBER;
   suma_saldos NUMBER; 
   total_ociosos NUMBER;
   total_saldos NUMBER;    
   resultado NUMBER;

BEGIN
--%_Utilizacion = 1-(SOcioso/SSaldo_Actual)
-- NOTA: PIVOT se resetea diariamente asi q remuevo los filtros de fecha.
   BEGIN
     SELECT SUM(OCIOSO) INTO suma_ociosos
     FROM PIVOT 
     WHERE COD_AGENCIA = P_CODIGO_SUC AND COD_MONEDA = P_CODIGO_MONEDA;
     --AND FECHA >= CURRENT_DATE AND FECHA < CURRENT_DATE+1 
     EXCEPTION
        WHEN TOO_MANY_ROWS THEN
          suma_ociosos := -2;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (TOO_MANY_ROWS) al calcular UTILIZACION - suma_ociosos. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
        WHEN NO_DATA_FOUND THEN
          suma_ociosos := -1;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (NO_DATA_FOUND) al calcular UTILIZACION - suma_ociosos. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
    END;
    BEGIN
     SELECT SUM(SALDO) INTO suma_saldos
     FROM PIVOT 
     WHERE COD_AGENCIA = P_CODIGO_SUC AND COD_MONEDA = P_CODIGO_MONEDA;
     --AND FECHA >= CURRENT_DATE AND FECHA < CURRENT_DATE+1 
     EXCEPTION
        WHEN TOO_MANY_ROWS THEN
          suma_saldos := -2;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (TOO_MANY_ROWS) al calcular UTILIZACION - suma_saldos. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
        WHEN NO_DATA_FOUND THEN
          suma_saldos := -1;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (NO_DATA_FOUND) al calcular UTILIZACION - suma_saldos. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
    END;
    total_ociosos := suma_ociosos + OCIOSO(P_CODIGO_SUC, P_CODIGO_MONEDA);
    total_saldos := suma_saldos + SALDO_ACTUAL(P_CODIGO_SUC, P_CODIGO_MONEDA);
   resultado := 1- (total_ociosos / total_saldos);
  
  RETURN resultado;
END UTILIZACION;

/
