--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "CFCUSER"."XBARRA" (P_CODIGO_SUC NUMBER, P_CODIGO_MONEDA NUMBER) RETURN NUMBER AS 
   sumatoria_saldo_actual NUMBER;
   cantidad_valores NUMBER;
   resultado NUMBER;

BEGIN
-- NOTA: PIVOT se resetea diariamente asi q remuevo los filtros de fecha.
   BEGIN 
     SELECT SUM(SALDO) INTO sumatoria_saldo_actual
     FROM PIVOT 
     where COD_AGENCIA = P_CODIGO_SUC AND COD_MONEDA = P_CODIGO_MONEDA; --AND FECHA >= CURRENT_DATE AND FECHA < CURRENT_DATE+1 
    EXCEPTION
        WHEN TOO_MANY_ROWS THEN
          sumatoria_saldo_actual := -2;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (TOO_MANY_ROWS) al calcular XBARRA - sumatoria_saldo_actual. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
        WHEN NO_DATA_FOUND THEN
          sumatoria_saldo_actual := -1;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (NO_DATA_FOUND) al calcular XBARRA - sumatoria_saldo_actual. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
    END;
   sumatoria_saldo_actual:= sumatoria_saldo_actual + SALDO_ACTUAL(P_CODIGO_SUC, P_CODIGO_MONEDA);
  BEGIN 
    SELECT COUNT(ID) INTO cantidad_valores
    FROM PIVOT 
    WHERE COD_AGENCIA = P_CODIGO_SUC AND COD_MONEDA = P_CODIGO_MONEDA; --AND FECHA >= CURRENT_DATE AND FECHA < CURRENT_DATE+1 
   EXCEPTION
        WHEN TOO_MANY_ROWS THEN
          cantidad_valores := -2;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (TOO_MANY_ROWS) al calcular XBARRA - cantidad_valores. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
        WHEN NO_DATA_FOUND THEN
          cantidad_valores := -1;
          DBMS_OUTPUT.PUT_LINE('Ocurrio un error (NO_DATA_FOUND) al calcular XBARRA - cantidad_valores. Agencia:' || P_CODIGO_SUC || ' Moneda:' || P_CODIGO_MONEDA);
    END;
    
  cantidad_valores:=cantidad_valores+1;
  resultado := sumatoria_saldo_actual / cantidad_valores;
  
  RETURN resultado;
END XBARRA;

   -- Agencia: 1150
