--  DDL for Procedure INSERCION
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "CFCUSER"."INSERCION" AS 
  codigo_sucursal NUMBER;
  codigo_moneda NUMBER;
  saldo NUMBER;
  lcsx_val NUMBER;
  lcx_val NUMBER;
  lcix_val NUMBER;
  rm_val NUMBER;
  lcsr_val NUMBER;
  lcr_val NUMBER;
  lcir_val NUMBER;
  seguro_max_val NUMBER;
  punto_reorden_val NUMBER;
  ocioso_val NUMBER;
  reserva_val NUMBER;
  menudo_val NUMBER;
  saldo_autorizado_val NUMBER;
  utilizacion_val NUMBER;
BEGIN
  FOR sucursal IN (
    SELECT SUCURSAL_PORCENT.ID_MONEDA, SUCURSAL_PORCENT.ID_SUCURSAL FROM MONEDA 
    LEFT OUTER JOIN SUCURSAL_PORCENT 
    ON SUCURSAL_PORCENT.ID_MONEDA = MONEDA.ID)
  LOOP
    BEGIN
    codigo_sucursal :=  sucursal.ID_SUCURSAL;
    codigo_moneda :=  sucursal.ID_MONEDA;
    saldo := SALDO_ACTUAL(codigo_sucursal, codigo_moneda);
    lcsx_val := LCSX(codigo_sucursal, codigo_moneda);
    lcx_val := LCX(codigo_sucursal, codigo_moneda);
    lcix_val := LCIX(codigo_sucursal, codigo_moneda);
    rm_val := RM(codigo_sucursal, codigo_moneda);
    lcsr_val := LCSR(codigo_sucursal, codigo_moneda);
    lcr_val := LCR(codigo_sucursal, codigo_moneda);
    lcir_val := LCIR(codigo_sucursal, codigo_moneda);
    seguro_max_val := SEGURO_MAX(codigo_sucursal, codigo_moneda);
    saldo_autorizado_val := SALDO_AUTORIZADO(codigo_sucursal, codigo_moneda);
    ocioso_val := OCIOSO(codigo_sucursal, codigo_moneda);
    reserva_val := RESERVA(codigo_sucursal, codigo_moneda);
    menudo_val := MENUDO(codigo_sucursal, codigo_moneda);
    utilizacion_val := UTILIZACION(codigo_sucursal, codigo_moneda);
    DBMS_OUTPUT.PUT_LINE('agencia:' || codigo_sucursal);
    DBMS_OUTPUT.PUT_LINE('moneda:' || codigo_sucursal);
    DBMS_OUTPUT.PUT_LINE('saldo:' || saldo);
    INSERT INTO PIVOT 
      (ID, FECHA, COD_AGENCIA, COD_MONEDA, SALDO, LCSX, LCX, LCIX, RM, LCSR, LCR, 
      LCIR, SEGURO_MAX, PUNTO_REORDEN, OCIOSO, RESERVA, MENUDO, SALDO_AUTORIZADO, 
      UTILIZACION)
    VALUES
      (pivot_seq.nextval, CURRENT_DATE, codigo_sucursal, codigo_moneda, saldo, lcsx_val, lcx_val, lcix_val, rm_val, lcsr_val, lcr_val, 
      lcir_val, seguro_max_val, punto_reorden_val, ocioso_val, reserva_val, menudo_val, saldo_autorizado_val,
      utilizacion_val);
    COMMIT; -- Por ahora estamos COMMITEANDO cada registro insertado. De ser necesario mejorar
            -- la performance enconces juntariamos de a 100 o 1000 inserts y hariamos un solo COMMIT.
    EXCEPTION
      WHEN DUP_VAL_ON_INDEX THEN
        DBMS_OUTPUT.PUT_LINE('Ocurrio un error al intentar INSERTAR. Agencia:' || codigo_sucursal || ' Moneda:' || codigo_moneda);
    END;
  END LOOP;

END INSERCION;

